"""Now, we need to split our dataset into training, validation, and testing dataset. To do so, we will use the following function. The function receives a Pandas DataFrame, a list of columns names that represent our features, the labels column name, and the percentage of splitting. The function will do stratified sampling, i.e., it will use the labels column to split data into homogeneous groups and then do random sampling with the given fraction from each group and combine them to form our splitted dataset."""

def random_split(data, features, output, fraction, seed=0):
    X_train, X_test, y_train, y_test = train_test_split(data[features],
                                                        data[output],
                                                        stratify = data[output],
                                                        random_state=seed,
                                                        train_size=fraction
                                                       )
    train_data = pd.DataFrame(data=X_train, columns=features)
    train_data[output] = y_train
    test_data = pd.DataFrame(data=X_test, columns=features)
    test_data[output] = y_test
    
    return train_data, test_data

