def train_n_test_classifier(clf, train_features, train_labels, test_features, test_labels):
    clf.fit(train_features, train_labels) # please learn patterns from the data

    print("score on training data:")
    print(clf.score(train_features, train_labels))
    print('_'*100)

    print("score on testing data:")
    pred_y = clf.predict(test_features)

    print('Precision: ')
    print(precision_score(test_labels, pred_y, average='micro'))

    print('Recall: ')
    print(recall_score(test_labels, pred_y, average='micro'))

    print('f1_score: ')
    print(f1_score(test_labels, pred_y, average='macro'))

    print('accuracy_score: ')
    print(accuracy_score(test_labels, pred_y))
    
    
    
    cm= confusion_matrix(test_labels,pred_y)
    cm_df=pd.DataFrame(cm,index= ['1','0'],columns = ['1','0'])
    sns.heatmap(cm_df , annot=True)
    plt.title('Accracy using brute:{0:.3f}'.format(accuracy_score(test_labels,pred_y)))
    plt.ylabel('Actual label')
    plt.xlabel('Predicted label')
    plt.show()

