def get_features_from_estimators(features, estimators):
     clfs_outputs = []
     for name, clf in estimators:
         clfs_outputs.append(clf.predict_proba(features)[:, 0].reshape(-1, 1))
     return np.concatenate(clfs_outputs, axis=1)

